import { useNavigate } from 'react-router-dom';

export const Stats = () => {

    const nav = useNavigate();

    return (
        <>
            <Button
                variant='outlined'
                onClick={() => nav("/setup")}
            >
                Play
            </Button>

            <h2>
                Stats
            </h2>



        </>
    );
};
